import connection from '../configs/connectDB'
let getHomepage = (req, res) => {
    let data = [];
    connection.query(`SELECT * FROM users`, (err, results, fields) => {
        results.map((row) => {
            data.push({
                id: row.id,
                email: row.email,
                fullName: row.Full_name
            })
        });
        return res.render('index.ejs', { dataUser: data });
    })
}

module.exports = {
    getHomepage
}

